'use strict';
exports.NgAdvancedSearchboxAddedFilterTemplate = "<div class=\"ng-advanced-searchbox-added-filter\" #ngAdvancedSearchboxAddedFilter=\"\"><div class=\"ng-advanced-searchbox-added-filter-contents\" (click)=\"openFilter();\"><span class=\"ng-advanced-searchbox-filter-name\" [innerText]=\"filter.displayName + ':'\"></span><template [ngIf]=\"filter &amp;&amp; filter.selector\"><span class=\"selector-type\" [innerText]=\"filter.selector.name\"></span></template><template [ngIf]=\"filter &amp;&amp; filter.value\"><span class=\"filter-value\" [innerText]=\"filter.value\"></span></template></div><template [ngIf]=\"filter &amp;&amp; filter.editing\"><input type=\"text\" [(ngModel)]=\"v\" (ngModelChange)=\"valueChange($event);\" (keydown)=\"onKeyDown($event);\" (keyup)=\"onKeyUp($event);\"/></template><ng-advanced-searchbox-filter-selectors [filter]=\"filter\"></ng-advanced-searchbox-filter-selectors><i class=\"fa fa-times\" (click)=\"destroy();\"></i></div>";
exports.NgAdvancedSearchboxFilterSelectorsTemplate = "<div class=\"ng-advanced-searchbox-filter-selectors\" [hidden]=\"!filter.editing\"><ul class=\"ng-advanced-searchbox-selectors-list\"><li *ngFor=\"let selector of selectors\" [ngClass]=\"{ 'active': selector.selected }\" (click)=\"takeSelector(selector);\"><span [innerText]=\"selector.name\"></span></li></ul></div>";
exports.NgAdvancedSearchboxAddedFiltersWrapperTemplate = "<div class=\"ng-advanced-searchbox-added-filters\">HELLO WORLD</div>";
exports.NgAdvancedSearchboxFilteringTemplate = "<div class=\"ng-filtering clearfix\"><span (click)=\"toggleFilters();\" [ngClass]=\"{ 'active': active }\"><i class=\"fa fa-filter\"></i></span><ul [hidden]=\"!active\"><li *ngFor=\"let filter of availableFilters\" [ngClass]=\"{ 'child-filter': filter.child, 'root-filter': filter.root }\" (click)=\"addFilter($event, filter.name);\"><i class=\"fa fa-filter\"></i><span class=\"ng-filter-display-name\" [innerText]=\"filter.displayName\"></span><span class=\"ng-filtered-from\"></span></li></ul></div>";
exports.NgAdvancedSearchboxTemplate = "<div class=\"ng-advanced-searchbox\"><template [ngIf]=\"ngSearchBoxFiltering\"><div>{{onChange}}</div><ng-advanced-searchbox-filtering [observer]=\"onChange\"></ng-advanced-searchbox-filtering></template><template [ngIf]=\"Filtering\"><div>{{Filtering.hasFilters}}</div></template><div class=\"ng-searchbox-wrapper\"><input [id]=\"sid\" type=\"text\" [(ngModel)]=\"query\" (ngModelChange)=\"queryChange($event);\" (keydown)=\"onKeyDown($event);\" [placeholder]=\"placeholder\"/><template [ngIf]=\"hasQuery\"><i class=\"fa fa-eraser\" (click)=\"handleEraser();\"></i></template><template [ngIf]=\"(hasQuery || (Filtering &amp;&amp; Filtering.hasFilters))\"><i class=\"fa fa-trash\" (click)=\"handleGarbage();\"></i></template></div><ng-advanced-searchbox-added-filters-wrapper [observer]=\"onChange\" #ngAdvancedSearchboxAddedFilters=\"\"></ng-advanced-searchbox-added-filters-wrapper></div>";
